import React from "react"
import Button from 'react-bootstrap/Button';
import styled from "styled-components";

const Movie = () => {

    return (
        <Container>
            <div className="img">
                <img src="https://external-preview.redd.it/qKqDBJXUFlCGtmXyMd3YKnEXvMkv0DRTvH1h7RQe-FU.jpg?auto=webp&s=3a00ebfc084ae73836088232c50069cca9c90631" alt="" />
            </div>
            <div className="jam">
                <h2>14 November 2022</h2>
                <Button variant="light">12.03</Button>{' '}
                <Button variant="light">13.10</Button>{' '}
                <Button variant="light">14.25</Button>{' '}
                <Button variant="light">15.30</Button>{' '}
                <Button variant="light">17.00</Button>{' '}
                <Button variant="light">19.10</Button>{' '}
                <Button variant="light">20.20</Button>{' '}
            </div>
        </Container>
    )
}

const Container = styled.div`
.jam {
  margin: auto;
  font-size: 1rem;
}
`;

export default Movie




